import React from 'react';
import styled from 'styled-components';

const Colomn = styled.div`
	display: flex;
	flex-direction: row;
`;

type ColProps = {
	children: any;
	classes?: string;
}

const Col = (props: ColProps) => <Colomn className={props.classes}>{props.children}</Colomn>

export default Col;
